INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (1, 2, 5118061, 10118, 8, "ペコリーヌとの出会い", 91002, "フリーマーケット会場", 0, 40, "青空の下で謁見", "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 7, 0, 2834);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (1, 2, 5118062, 10118, 8, "マホとの出会い", 91002, "フリーマーケット会場", 0, 40, "未来の騎空団\nマスコット？", "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 7, 0, 2835);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (1, 2, 5118063, 10118, 8, "アキノとの出会い", 91002, "ランドソル市街地", 0, 40, "お嬢さまからの\n緊急依頼", "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 7, 0, 2837);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (1, 2, 5118064, 10118, 8, "ジュンとの出会い", 91002, "フリーマーケット会場", 0, 40, "黄金色の悩みごと", "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 18, 0, 4108402);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (1, 2, 5118065, 10118, 8, "カオリとの出会い", 91002, "フリーマーケット会場", 0, 40, "白熱！　格闘大会！", "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 18, 0, 4107402);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (1, 2, 5118066, 10118, 8, "ニノンとの出会い", 91002, "オーエド町", 1, 40, "祭り太鼓はオーエドの華", "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 16, 0, 9000227);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (1, 3, 5118067, 10118, 8, "スズナとの出会い", 91002, "フリーマーケット会場", 0, 40, "人気者は遅れて\nやってくる", "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 19, 0, 2101181);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (1, 3, 5118068, 10118, 8, "ナナカとの出会い", 91002, "ランドソル市街地", 0, 40, "巫女・ミーツ・魔法少女", "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 18, 0, 4109402);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (1, 3, 5118069, 10118, 8, "キャル＆コッコロとの出会い", 91002, "フリーマーケット会場", 0, 40, "ネズ耳は二度なくなる", "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 18, 0, 4305402);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (1, 3, 5118070, 10118, 8, "ユカリとの出会い", 91002, "ランドソル市街地", 0, 40, "この出会いにカンパイ！", "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 18, 0, 4101402);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (1, 3, 5118071, 10118, 8, "アオイとの出会い", 91002, "ランドソル市街地", 0, 40, "陰陽アンサンブル", "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 18, 0, 4106402);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (1, 3, 5118072, 10118, 8, "シノブとの出会い", 91002, "フリーマーケット会場", 1, 40, "運試し十番勝負！", "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 7, 0, 2836);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (0, 1, 5118600, 10118, 0, "オープニング", 0, 0, 0, 0, "彼女たちの新たな日常", 0, 0, 10145115, 0);
